func TestParser(t *testing.T) {
	buff := bytes.NewBufferString(testSite)
	sm := statusMap{}

	parse(buff, &sm)

	if len(sm.m) != len(expectedResult.m) {
		t.Log("Resulting number of services does not match expected. Got", len(sm.m), "Expected", len(expectedResult.m))
		t.Fail()
	}

	if len(sm.n) != len(expectedResult.n) {
		t.Log("Resulting number of faulty services does not match expected. Got", len(sm.n), "Expected", len(expectedResult.n))
		t.Fail()
	}

	if sm.n[0].Details != expectedResult.n[0].Details {
		t.Log("Resulting faulty service not matching. Got", len(sm.n[0].Details), "Expected", len(expectedResult.n[0].Details))
		t.Fail()
	}
}

func TestNotifier(t *testing.T) {
	buff := bytes.NewBufferString(testSite)
	sm := statusMap{}

	parse(buff, &sm)

	var note string

	sm.notifier = func(s status) error {
		note = fmt.Sprintf("%#v", s)
		return nil
	}

	sm.Notify()

	if note != fmt.Sprintf("%#v", expectedResult.n[0]) {
		t.Log("Notifier reported wong result. Got", note, "Expected", fmt.Sprintf("%#v", expectedResult.n[0]))
		t.Fail()
	}
}

